DROP TABLE IF EXISTS `t_mission`;
CREATE TABLE `t_mission` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `task_id` bigint(20) DEFAULT '0' COMMENT '任务id',
  `user_id` bigint(20) DEFAULT '0' COMMENT '刷手id',
  `seller_id` bigint(20) DEFAULT '0' COMMENT '商家id',
  `shop_id` bigint(20) DEFAULT '0' COMMENT '店铺id',
  `mission_code` varchar(50) DEFAULT '' COMMENT '订单编号',
  `user_name` varchar(20) DEFAULT NULL COMMENT '刷手名称',
  `mobile` varchar(20) DEFAULT NULL COMMENT '刷手手机号',
  `key_word` varchar(255) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '关键字',
  `shop_category_id` bigint(20) DEFAULT NULL COMMENT '店铺类目ID,关联',
  `shop_category` varchar(50) DEFAULT NULL COMMENT '店铺类目',
  `status` int(1) DEFAULT NULL COMMENT '订单状态：1订单待认证,2订单待拍下,3订单已拍下,4商家已汇款,5刷手已付款,6商家已发货,7刷手已收货（结单）',
  `task_style` int(1) DEFAULT NULL COMMENT '任务类型（0：精刷单，1：标签二天，2：标签三天）',
  `pay_time` datetime DEFAULT NULL COMMENT '刷手已付款时间',
  `mission_time` datetime DEFAULT NULL COMMENT '执行时间',
  `shop_name` varchar(50) DEFAULT NULL COMMENT '店铺名称',
  `seller_name` varchar(50) DEFAULT NULL COMMENT '商家名称',
  `taobao` varchar(200) DEFAULT NULL COMMENT '淘宝名称',
  `taobao_code` varchar(50) DEFAULT NULL COMMENT '淘宝订单号',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '本金',
  `is_mark` int(1) DEFAULT '1' COMMENT '标记信息（1：无标记、未标记，2：已标记）',
  `mark` varchar(255) DEFAULT NULL COMMENT '标记信息',
  `in_charge_id` bigint(20) DEFAULT NULL COMMENT '订单处理人员id',
  `platform_name` varchar(20) DEFAULT NULL COMMENT 't_category处理客服名称',
  `user_note` varchar(255) DEFAULT NULL COMMENT '刷手备注',
  `is_pay` int(1) DEFAULT '1' COMMENT '是否打款（1：否，2是）',
  `is_bad` int(1) DEFAULT '1' COMMENT '报错处理（1未报错，2：已报错，3：报错已处理）',
  `is_annul` int(1) DEFAULT '1' COMMENT '订单是否撤销（1：否，2：是）',
  `role` int(1) DEFAULT '0' COMMENT '订单审核状态（0：初始状态，1、订单待审核2、审核通过、3：已拒绝）',
  `order_time` datetime DEFAULT NULL COMMENT '接单时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `inChargeId` (`in_charge_id`,`role`,`mission_time`),
  KEY `role` (`role`,`mission_time`) USING BTREE,
  KEY `sellerId` (`seller_id`),
  KEY `userId` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=348 DEFAULT CHARSET=utf8 COMMENT='订单管理';

