DROP TABLE IF EXISTS `t_mission_detail`;
CREATE TABLE `t_mission_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `mission_id` bigint(20) DEFAULT NULL COMMENT '关联t_mission表',
  `card_number` varchar(20) DEFAULT NULL COMMENT '持卡人银行卡号',
  `bank` varchar(20) DEFAULT NULL COMMENT '持卡人所属银行',
  `holder` varchar(50) DEFAULT NULL COMMENT '持卡人',
  `style` varchar(100) DEFAULT NULL COMMENT '宝贝款号',
  `order` int(1) DEFAULT NULL COMMENT '(1:综合排序，2：销量排序，3：价格排序)',
  `interval_begin` bigint(20) DEFAULT NULL COMMENT '排名区间起点',
  `interval_end` bigint(20) DEFAULT NULL COMMENT '排名区间终点',
  `note` text COMMENT '订单详情-订单信息-备注（任务要求）',
  `other_note` text COMMENT '其他要求',
  `img` varchar(255) DEFAULT NULL COMMENT '产品主图',
  `publish_time` datetime DEFAULT NULL COMMENT '审核通过时间',
  `begin_time` datetime DEFAULT NULL COMMENT '任务执行起止时间',
  `url` varchar(400) DEFAULT NULL COMMENT '商品链接',
  `agent_money` decimal(10,2) DEFAULT '0.00' COMMENT '代理商所获取的利润',
  `user_pay` decimal(10,2) DEFAULT NULL COMMENT '刷单之后获得的佣金',
  `commentable` int(1) DEFAULT NULL COMMENT '是否可评价（1：否，2是）',
  `role` int(1) DEFAULT NULL COMMENT '订单审核状态（1、订单待审核2、审核通过、3：已拒绝）',
  `need_check` int(1) DEFAULT NULL COMMENT '订单是否认证之后可以继续（1：是，2：否）',
