  `is_comment` int(1) DEFAULT '1' COMMENT '(1：商家未指定评价，2：商家已指定评价，3：刷手已完成指定评价，4：追评被撤销）',
  `is_addCom` int(1) DEFAULT '1' COMMENT '追评状态（1：商家未指定，2商家已指定追评，3：刷手 已完成追评，4：追评被撤销）',
  `xiaohao` varchar(255) DEFAULT NULL COMMENT '小号评价',
  `buy` varchar(255) DEFAULT NULL COMMENT '已买宝贝',
  `check` varchar(255) DEFAULT NULL COMMENT '体验中心',
  `compare_one` varchar(255) DEFAULT NULL COMMENT '货比三家1',
  `compare_two` varchar(255) DEFAULT NULL COMMENT '货比三家2',
  `compare_three` varchar(255) DEFAULT NULL COMMENT '货比三家3',
  `footprint` varchar(255) DEFAULT NULL COMMENT '足迹图片',
  `collection_com` varchar(255) DEFAULT NULL COMMENT '关注,收藏店铺',
  `add_cart` varchar(255) DEFAULT NULL COMMENT '店内宝贝1，（加入购物车截图）',
  `add_cart2` varchar(255) DEFAULT NULL COMMENT '店内宝贝2',
  `shop_one` varchar(255) DEFAULT NULL COMMENT '假聊截图',
  `key_search` varchar(255) DEFAULT NULL COMMENT '关键字搜索截图',
  `glance_com` varchar(255) DEFAULT NULL COMMENT '浏览评价截图',
  `paying` varchar(255) DEFAULT NULL COMMENT '待付款截图',
  `same_style` varchar(255) DEFAULT NULL COMMENT '店内同款',
  `paied` varchar(255) DEFAULT NULL COMMENT '已付款截图',
  `receive` varchar(255) DEFAULT NULL COMMENT '确认收货截图',
  `update_time` datetime DEFAULT NULL,
  `remit_time` datetime DEFAULT NULL COMMENT '第一次拍下，生成打款订单时间',
  `comment` varchar(255) DEFAULT NULL COMMENT '商家上传评价文本',
  `comment_time` datetime DEFAULT NULL COMMENT '评论时间（收获时间）',
  `comment_img` varchar(255) DEFAULT NULL COMMENT '刷手指定评价截图',
  `comment_pay` decimal(10,2) DEFAULT '0.00' COMMENT '指定评价商家支付的的佣金',
  `comment_user` decimal(10,2) DEFAULT '0.00' COMMENT '指定评价，刷手获取的不可提现佣金',
  `img_list` text COMMENT '商家上传评价截图',
  `small_video` varchar(200) DEFAULT NULL COMMENT '商家上传评价小视频',
  `finish_com_time` datetime DEFAULT NULL COMMENT '指定评价完成时间',
  `addCom` varchar(255) DEFAULT NULL COMMENT '指定追评内容',
  `add_com_user` decimal(10,2) DEFAULT NULL COMMENT '指定追评价刷手可获取佣金',
  `add_com_pay` decimal(10,2) DEFAULT NULL COMMENT '指定追评商家支付佣金',
  `add_com_img` varchar(225) DEFAULT NULL COMMENT '刷手指定追评截图',
  `add_imgList` text COMMENT '商家上传指定追评截图',
  `add_small_video` varchar(200) DEFAULT NULL COMMENT '指定追评小视频',
  `finish_add_com_time` datetime DEFAULT NULL COMMENT '完成指定追评时间',
  `refuse_note` varchar(255) DEFAULT NULL COMMENT '拒绝备注',
  `cancel_note` varchar(255) DEFAULT NULL COMMENT '撤销备注',
  `bad_info` varchar(255) DEFAULT NULL COMMENT '报错信息',
  `user_note` varchar(255) DEFAULT NULL COMMENT '刷手备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `mission_id` (`mission_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=348 DEFAULT CHARSET=utf8 COMMENT='订单详情';

