DROP TABLE IF EXISTS `t_seller`;
CREATE TABLE `t_seller` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `pid` bigint(20) DEFAULT NULL COMMENT '上级商家ID',
  `is_seller` int(1) DEFAULT '0' COMMENT '上级类型（0：平台，1：商家，2：刷手,3:代理商）',
  `contact` varchar(50) DEFAULT NULL COMMENT '商家联系人姓名',
  `mobile` varchar(20) DEFAULT NULL COMMENT '商家手机号',
  `password` varchar(255) DEFAULT NULL COMMENT '商家账号密码',
  `weChat` varchar(50) DEFAULT NULL COMMENT '微信号',
  `note` varchar(255) DEFAULT NULL COMMENT '商家备注',
  `qq` varchar(20) DEFAULT NULL COMMENT 'QQ',
  `balance` decimal(10,2) DEFAULT '0.00' COMMENT '商家余额',
  `limit` decimal(10,2) DEFAULT '0.00' COMMENT '商家发布任务的商品单价（本金）限制',
  `is_vip` int(1) DEFAULT '1' COMMENT '是否为vip（1：否，2：是）',
  `publishable` int(1) DEFAULT '1' COMMENT '商家发单权限(1:可以，2：不可以)',
  `benefit` decimal(10,2) DEFAULT '0.00' COMMENT '佣金优惠',
  `amount` decimal(10,2) DEFAULT '0.00' COMMENT '管理平台修改商家的金额',
  `status` int(1) DEFAULT '1' COMMENT '注册状态（1：未审核，2：已审核，3：被拒绝）',
