DROP TABLE IF EXISTS `t_shop`;
CREATE TABLE `t_shop` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `seller_id` bigint(20) DEFAULT NULL COMMENT '商家,id关联t_seller表',
  `category_id` varchar(20) DEFAULT NULL COMMENT '店铺类目ID,关联t_category表',
  `name` varchar(50) DEFAULT NULL COMMENT '店铺姓名',
  `contact` varchar(50) DEFAULT NULL COMMENT '店铺联系人',
  `mobile` varchar(20) DEFAULT NULL COMMENT '商家手机号',
  `category` varchar(50) DEFAULT NULL COMMENT '店铺类目',
  `url` varchar(255) DEFAULT NULL COMMENT '店铺链接',
  `platform` int(1) DEFAULT NULL COMMENT '店铺所属平台(1:淘宝，2：天猫，3：京东)',
  `role` int(1) DEFAULT '1' COMMENT '店铺状态(1店铺未提交审核,2待审核,3已审核,4已驳回)',
  `total` int(5) DEFAULT '0' COMMENT '一天内店铺能发单的上限',
  `interval` int(5) DEFAULT '0' COMMENT '同一刷手接同一店铺的单周期',
  `is_publish` int(5) DEFAULT '0' COMMENT '一天之内本店铺已发单数量',
  `last_publish` datetime DEFAULT NULL COMMENT '店铺的最后发单时间',
  `is_default` int(1) DEFAULT '2' COMMENT '是否默认店铺（1：是，2：否）',
  `status` int(1) DEFAULT '1' COMMENT '店铺禁用状态(1:正常，2：被禁用)',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  `pass_time` datetime DEFAULT NULL COMMENT '店铺审核通过时间',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=114 DEFAULT CHARSET=utf8 COMMENT='店铺表';

