-- ----------------------------
-- Table structure for t_task
-- ----------------------------
DROP TABLE IF EXISTS `t_task`;
CREATE TABLE `t_task` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `seller_id` bigint(20) DEFAULT NULL COMMENT '商家id，关联t_seller表',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '商家店铺id',
  `seller_name` varchar(50) DEFAULT NULL COMMENT '商家名称',
  `img` varchar(255) DEFAULT NULL COMMENT '产品主图',
  `shop_name` varchar(50) DEFAULT NULL COMMENT '店铺名称',
  `shop_category_id` bigint(20) DEFAULT NULL COMMENT '店铺类目ID,关联t_category表',
  `shop_category` varchar(50) DEFAULT NULL COMMENT '店铺类目',
  `url` varchar(255) DEFAULT NULL COMMENT '店铺链接',
  `style` varchar(255) DEFAULT NULL COMMENT '产品款号',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价，每单订单的商品价格',
  `keyWord` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '关键词',
  `order` int(1) DEFAULT NULL COMMENT '排序方式(1综合排序,2销量排序,3价格排序)',
  `interval_begin` int(10) DEFAULT NULL COMMENT '排名区间起点',
  `interval_end` int(10) DEFAULT NULL COMMENT '排名区间终点',
  `note` text COMMENT '任务要求',
  `other_note` varchar(255) DEFAULT NULL COMMENT '其他要求',
  `role` int(1) DEFAULT '1' COMMENT '任务审核状态(1任务未审核,2任务已审核,3任务未通过、已拒绝)',
  `publish_time` datetime DEFAULT NULL COMMENT '任务审核通过的时间',
  `feedback` varchar(255) DEFAULT NULL COMMENT '平台管理对任务审核的意见（包括通过和拒绝）',
  `amount` int(5) DEFAULT NULL COMMENT '任务总单数',
  `interval` int(5) DEFAULT NULL COMMENT '每单任务的间隔时间',
  `task_style` int(1) DEFAULT NULL COMMENT '任务类型(0:精刷单,1:标签二天，2：标签三天，3：流量单)',
  `appoint` int(5) DEFAULT NULL COMMENT '预约刷单天数',
  `in_charge_id` bigint(20) DEFAULT NULL COMMENT '任务审核客服的id',
  `accept` int(5) DEFAULT '0' COMMENT '任务已接数量（不包含被撤销的任务）',
  `remain` int(5) DEFAULT NULL COMMENT '任务剩余数量',
  `begin_time` datetime DEFAULT NULL COMMENT '第一个任务订单能够被刷手接的时间，即任务的起始执行时间',
  `user_id_list` varchar(255) DEFAULT NULL COMMENT '已接过这个任务的刷手列表（？包括被撤销的刷手吗）',
  `platform_name` varchar(50) DEFAULT NULL COMMENT '任务客服名称',
  `remove` int(5) DEFAULT '0' COMMENT '某个任务被撤销的订单数量',
  `view_pay` int(10) DEFAULT '0' COMMENT '对于预约任务（标签二、三天），商家所需要支付的总浏览佣金（佣金规则中单价对应的浏览佣金*总单数）',
  `agent_money` decimal(10,2) DEFAULT '0.00' COMMENT '代理商所赚的金额',
  `seller_pay` decimal(10,2) DEFAULT '0.00' COMMENT '商家发任务中精刷单所需支付的佣金（佣金规则单价对应支付佣金*总单数）',
  `user_pay` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '刷手接单之后获得的不可提现佣金',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `inChageId` (`role`,`in_charge_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=238 DEFAULT CHARSET=utf8 COMMENT='任务表';

-- ----------------------------
-- Records of t_task
-- ----------------------------

