DROP TABLE IF EXISTS `t_task_mould`;
CREATE TABLE `t_task_mould` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `seller_id` bigint(20) DEFAULT NULL COMMENT '商家id,关联t_seller',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id，关联t_shop',
  `img` varchar(500) DEFAULT NULL COMMENT '产品主图',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  `url` varchar(255) DEFAULT NULL COMMENT '商品链接',
  `style` varchar(255) DEFAULT NULL COMMENT '商品款号',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '商品价格',
  `keyWord` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '商品关键字',
  `order` int(1) DEFAULT NULL COMMENT '商品排序方式（1：综合排序，2：销量排序，3：价格排序）',
  `interval_begin` int(10) DEFAULT NULL COMMENT '商品排序方式起始排名',
  `interval_end` bigint(10) DEFAULT NULL COMMENT '商品排列方式终止排名',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  `other_note` varchar(300) DEFAULT NULL COMMENT '其他要求',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COMMENT='任务模板';

