  `card_number` varchar(20) DEFAULT NULL COMMENT '刷手银行卡号',
  `bank` varchar(20) DEFAULT NULL COMMENT '刷手银行卡所属银行',
  `positive` varchar(255) DEFAULT NULL COMMENT '身份证正面照片',
  `back` varchar(255) DEFAULT NULL COMMENT '身份证反面照片',
  `parent_invitation` varchar(255) DEFAULT NULL COMMENT '上级邀请码',
