  `xiaohao` varchar(255) DEFAULT NULL COMMENT '小号评价截图',
  `buy` varchar(255) DEFAULT NULL COMMENT '淘宝账号已购买宝贝截图',
  `check` varchar(255) DEFAULT NULL COMMENT '淘宝账号体验中心截图',
  `weChatQr` varchar(255) DEFAULT NULL COMMENT '刷手微信二维码',
  `ali` varchar(255) DEFAULT NULL COMMENT '刷手支付宝信息截图',
  `sex` varchar(255) DEFAULT NULL COMMENT '性别照片',
  `note` varchar(255) DEFAULT NULL COMMENT '刷手备注',
  `role` int(1) DEFAULT '1' COMMENT '是否入黑名单（1：否，2：是）',
  `limit` int(10) DEFAULT NULL COMMENT '被允许接单的商品最大单价',
  `day_limit` int(10) DEFAULT NULL COMMENT '日接单数量限制',
  `month_limit` int(10) DEFAULT NULL COMMENT '月结单数量限制',
  `with_limit` int(10) DEFAULT NULL COMMENT '提现底线限制',
  `mobile_for_taobao` varchar(20) DEFAULT NULL COMMENT '刷手淘宝手机号',
  `amount` decimal(10,2) DEFAULT '0.00' COMMENT '管理平台修改刷手的金额',
  `email` varchar(50) DEFAULT NULL COMMENT '刷手邮箱',
  `last_receive` datetime DEFAULT NULL COMMENT '刷手最近一次接单订单并审核通过的时间',
  `highest_user_id` varchar(50) DEFAULT NULL COMMENT '最高级刷手ID',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
