INSERT INTO `t_inform` VALUES ('2', '<p><span style=\"font-family: 宋体; font-size: 20px;\">接单任务流程，请认真看完。</span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">&nbsp;</span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第一步，接受任务。</span><br/></p><p><span style=\"font-family: 宋体; font-size: 20px;\"><br/></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;<img src=\"http://chaoshua.8848s.cn/upload/20190115/976806aeaf9f4441a0e1ffb8ecc0ea93.png\" title=\"1.png\"/></span></p><p><span style=\";font-family:宋体;font-size:14px\"><br/></span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第二步，接受成功，认证图片导入平台。</span></p><p><span style=\"font-family: 宋体; font-size: 14px;\"></span><br/></p><p><span style=\";font-family:宋体;font-size:14px\"><img src=\"http://chaoshua.8848s.cn/upload/20190115/86ce4d90ee684b81b6e591ba9344e25d.png\" title=\"2.png\"/></span></p><p><span style=\";font-family:宋体;font-size:14px\"><br/></span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第三步，审核中，等待5分钟刷新，查看任务是否通过。</span></p><p><span style=\"font-family: 宋体; font-size: 14px;\"><br/></span></p><p><span style=\";font-family:宋体;font-size:14px\"><img src=\"http://chaoshua.8848s.cn/upload/20190115/4a6450107cd8494d9158c5f2d0450611.png\" title=\"3.png\"/></span></p><p><span style=\";font-family:宋体;font-size:14px\"><br/></span></p><p></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第四步，审核通过 <span style=\"font-family: 宋体; background-color: rgb(253, 234, 218);\">查看</span>，<span style=\"font-family: 宋体; color: rgb(255, 0, 0);\">看清任务要求</span>，做完图片上传任务导入，等待打款。</span></p><p><span style=\";font-family:宋体;font-size:14px\"></span><br/></p><p><span style=\";font-family:宋体;font-size:14px\"><img src=\"http://chaoshua.8848s.cn/upload/20190115/6c2dddcaa980490d9e4860693c697df6.png\" title=\"4.png\"/></span></p><p><span style=\";font-family:宋体;font-size:14px\"></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第五步，订单成为已拍下状态等待打款</span><span style=\"font-size: 14px; font-family: 宋体;\">。</span></p><p><span style=\";font-family:宋体;font-size:14px\"></span><br/></p><p><span style=\";font-family:宋体;font-size:14px\"></span></p><p></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第六步，商家打款成功，订单状态成为 商家已汇款，付款上传图片即可。</span></p><p><span style=\"font-size: 14px; font-family: 宋体;\"><br/></span></p><p><span style=\"font-size: 14px; font-family: 宋体;\"><img src=\"http://chaoshua.8848s.cn/upload/20190115/018691c65f31455aa2da5aa245a59dc9.png\" title=\"6.png\"/></span></p><p><span style=\"font-size: 14px; font-family: 宋体;\"><br/></span></p><p><span style=\"font-size: 14px; font-family: 宋体;\"></span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第七步，商家发货后，订单成为已发货，等物流签收后，上传图片。</span></p><p><span style=\"font-size: 14px; font-family: 宋体;\"></span><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/3383be0069b94c47bb179deffbbde361.png\" title=\"7.png\"/></p><p><br/></p><p><span style=\"font-family: 宋体; font-size: 20px;\">第八步，<span style=\"font-family: 宋体; color: rgb(255, 0, 0);\">指定评价</span>，收货导入时，如果出现评价和截图信息，该订单就被商家指定评价了，按照商家的指定评价和截图去操作完成。</span></p><p><br/></p><p></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/1665f63b326d4197b95eec9b23661c3b.png\" title=\"8.png\"/></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\"font-size: 14px; font-family: 宋体;\">看完，请去看其他公告，谢谢</span></p><p><br/></p>', '接单任务流程（请认真看完）', '2', '2019-01-15 03:31:03', null);
INSERT INTO `t_inform` VALUES ('3', '<p><br/></p><p style=\"text-align: center;\"><br/></p><p><span style=\"font-size: 36px;\">第一步：</span><span style=\"font-weight: 700; font-family: 宋体, SimSun; background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-size: 36px;\">充值成功后，提交客服审核</span></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/e8074196ada048bcb971619b809aa550.jpg\" title=\"1.jpg\" alt=\"1.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第二步：点击添加店铺，提交客服审核</span><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/056bdc034e614c6ea80a3e4341169f08.jpg\" title=\"2.jpg\" alt=\"2.jpg\"/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/d61c35ec2267447c97d80ee8317e71bb.jpg\" title=\"3.jpg\" alt=\"3.jpg\"/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/22c228adfd7e4ae1a82ac02935649f47.jpg\" title=\"4.jpg\" alt=\"4.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第三步：创建任务模板，提交审核</span><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/1d3fc1ddf60c46be9398e8a4ef406680.jpg\" title=\"5.jpg\" alt=\"5.jpg\"/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/508224345b184b70800b289d1f0ab7d4.jpg\" title=\"6.jpg\" alt=\"6.jpg\"/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/252517a778ab4311bc142cd5986979e0.jpg\" title=\"7.jpg\" alt=\"7.jpg\"/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/16c53aa50db3448aaee8b4dddc11b995.jpg\" title=\"8.jpg\" alt=\"8.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第四步：发布任务后，提交审核</span><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/85fc09fc445243e399a828feb62cc93a.jpg\" title=\"9.jpg\" alt=\"9.jpg\"/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/dfc4304ea178441ea186172e0b9f516d.jpg\" title=\"10.jpg\" alt=\"10.jpg\"/></p><p><span style=\"font-size: 36px;\">第五步：点击任务列表，查看发布情况</span></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/f619c60796224702bd08911481d6efc3.jpg\" title=\"11.jpg\" alt=\"11.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第六步：点击订单管理，查看任务</span><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/79975db33430426a9e86b131c06368b5.jpg\" title=\"12.jpg\" alt=\"12.jpg\"/><br/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/200faf25cf564510b94a566e2deadabc.jpg\" title=\"13.jpg\" alt=\"13.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第七步：打款管理，操作步骤如下图</span><br/></p><p><span style=\"font-size: 24px;\">打款成功后要点击确认打款，不点确认打款 ，刷手是不会把订单付款的</span></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/1f680a82b40a4150b82d0ae4c141a5cb.jpg\" title=\"15.jpg\" alt=\"15.jpg\"/></p><p><br/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/10a2d6799f5d4257b1754248b5a013ad.jpg\" title=\"16.jpg\" alt=\"16.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第八步：点击发货管理</span><br/></p><p><span style=\"font-size: 24px;\">在刷手把付款图上传后，请商家批量给刷手点击确认发货。<br/></span></p><p><span style=\"font-size: 24px;\">如果不点击发货，物流签收了刷手是不会去点击签收的</span><span style=\"font-size: 36px;\">。</span></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/82eb8969b00b41dd85787b77777610b9.jpg\" title=\"17.jpg\" alt=\"17.jpg\"/></p><p><br/></p><p><span style=\"font-size: 36px;\">第九步：指定评价和指定追评，如下图操作。</span></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/b7fae124833a416991c95569dcf07df5.jpg\" title=\"18.jpg\" alt=\"18.jpg\"/></p><p><br/></p><p><br/></p><p><br/></p><p><img src=\"http://chaoshua.8848s.cn/upload/20190115/7c83387369fe45778576bf95b36f7670.jpg\" title=\"19.jpg\" alt=\"19.jpg\"/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p>', '平台操作流程（请认真看完）', '1', '2019-01-15 08:59:09', '2019-01-15 13:29:43');
INSERT INTO `t_inform` VALUES ('14', '<p><span style=\"font-family: 宋体; font-size: 20px;\">重要通知（请每个人都认真看下）</span></p><p><strong><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">平台任务时间是</span><span style=\"font-family: 宋体; font-size: 14px; color: rgb(255, 0, 0);\">24<span style=\"font-family: 宋体;\">小时制</span></span></span></strong><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family: 宋体; font-size: 14px; color: rgb(255, 0, 0);\"><span style=\"font-family: 宋体;\"></span></span><span style=\"font-family:宋体\">，</span><strong><span style=\"font-family:Calibri\">0</span><span style=\"font-family:宋体\">点</span><span style=\"font-family:Calibri\">-24</span><span style=\"font-family:宋体\">点。接受任务成功的请看好时间去下单</span></strong><span style=\"font-family:宋体\">。</span></span></p><p><span style=\"font-size: 14px; font-family: 宋体;\">如时间已过，请当下接到接到任务时直接去完成任务。</span></p><p><span style=\"font-size: 14px; font-family: 宋体; color: rgb(255, 0, 0);\">关键词找不到的，价格不对的，请联系微信客服，直接打语音电话，不要只留言，信息太多会被覆盖，<span style=\"font-family: 宋体; font-size: 18px; background-color: rgb(253, 234, 218);\">打语音电话</span>。</span></p><p><strong><span style=\"font-size: 14px; font-family: 宋体;\">任务没有物流记录的，请在付款后的第七天再去确认收货。</span></strong></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\"font-family: 宋体; font-size: 14px; color: rgb(192, 0, 0);\">所有进入平台的会员首先加一下微信客服：<strong><span style=\"font-family: 宋体; background-color: rgb(255, 255, 0); font-size: 20px;\">hc100886699</span></strong> 。微信通过时，备注好自己的淘宝会员名</span><span style=\"font-size: 14px; font-family: 宋体;\">。</span></p><p><span style=\"font-size: 14px; font-family: 宋体;\">做任务首先店铺、价格核对清楚，要拍对。不然会被撤销任务。</span></p><p><span style=\"font-family: 宋体; font-size: 14px; color: rgb(0, 112, 192);\">邀请下级拿邀请码请加QQ客服：<span style=\"font-family: 宋体; font-size: 18px; background-color: rgb(255, 255, 0);\"><strong><span style=\"font-size: 18px; background-color: rgb(255, 255, 0); font-family: Calibri;\">1092938572</span></strong></span><span style=\"font-size: 14px; font-family: Calibri;\"> </span>。</span></p><p><span style=\"font-family: 宋体; font-size: 14px; color: rgb(0, 112, 192);\">（邀请的下级必须是自己认识的，现实中能找到的人，严禁邀请不认识的人，否则下级出现任何问题，上级全权负责。）</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">平台实行抽成制度，拉下级可以享受任务抽成</span>1<span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">单。可以享受</span><span style=\"font-family:Calibri\">2</span><span style=\"font-family:宋体\">层抽成（下级的下级做任务你同样有</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">的抽成）</span></span></p><p><span style=\"font-family: 宋体; font-size: 14px; color: rgb(112, 48, 160);\">注册审核没通过的刷手请去加QQ客服：<span style=\"font-size: 14px; font-family: Calibri;\">1092938572 ，询问没通过的原因，更改注册资料。</span></span></p><p><span style=\"font-size: 14px; font-family: Calibri;\"><br/></span></p><p><span style=\"font-size: 14px; font-family: 宋体;\">注：任务流程请参考公告的第二条。</span></p><p><br/></p>', '重要通知（请每个人都认真看下）', '2', '2019-01-16 04:22:56', null);
